# Register: enumgmsa
from typing import List
from core.gunnershell.bofs.base import Bof, register
import argparse
from colorama import Style, Fore

brightgreen = "\001" + Style.BRIGHT + Fore.GREEN + "\002"
reset = Style.RESET_ALL

def _space_escape(s: str) -> str:
    return (s or "").replace(" ", "%20")

def _fmt_to_code(s: str) -> int:
    s = (s or "").lower()
    if s == "json": return 1
    if s == "csv":  return 2
    if s == "table":return 3
    return 0  # kv (default)

@register("enumgmsa")
class EnumGmsaBof(Bof):
    # TODO: replace with your compiled base64 BOF blobs
    base64bof: str = ""
    x86base64bof: str = "<FILL_ME_X86_BASE64>"

    @staticmethod
    def help_menu():
        menu = f"""
enumgmsa — Enumerate principals allowed to retrieve gMSA passwords

Purpose
  For each gMSA, list effective principals (users/computers) who can retrieve its password,
  expanding nested groups from msDS-GroupMSAMembership (aka PrincipalsAllowedToRetrieveManagedPassword).

Usage
  bofexec enumgmsa [--gmsa <DN|name|*>] [-d <domain>] [--dc <hostname>] [--ldaps] [--port <int>] [--format csv|json|kv|table]

Connection
  -d, --domain <dns>    DNS name of the AD domain (e.g., contoso.com) — used for DC discovery & baseDN if not supplied
  --dc <hostname>       Domain Controller hostname/FQDN (optional; if omitted we use the library default resolver)
  --ldaps               Use LDAPS (default port 636). If not set -> LDAP (default port 389).
  --port <int>          Override port. If 0/omitted -> default by scheme.

Selection & Output
  --gmsa <DN|name|*>    Target a single gMSA by DN or name (sAMAccountName or CN). Default '*' = all gMSAs.
  --format <fmt>        Output format: csv | json | kv | table (default kv)

Examples
  bofexec enumgmsa --format kv
  bofexec enumgmsa --gmsa * --format table
  bofexec enumgmsa --gmsa SQLSvc$ --format csv
  bofexec enumgmsa --gmsa "CN=WEB01$,CN=Managed Service Accounts,DC=bank,DC=local" -d bank.local --ldaps --format json
"""
        print(brightgreen + menu + reset)
        return

    @staticmethod
    def args_inject(p):
        # Connection
        p.add_argument("-d", "--domain", default="", help="DNS domain (e.g., contoso.com)")
        p.add_argument("--dc", default="", help="Domain Controller hostname/FQDN")
        p.add_argument("--ldaps", action="store_true", default=False, help="Use LDAPS (default 636)")
        p.add_argument("--port", type=int, default=0, help="LDAP/LDAPS port (0 => default by scheme)")

        # Selection / Output
        p.add_argument("--gmsa", default="*", help="gMSA DN or name (sAMAccountName or CN), or '*' (default)")
        p.add_argument("--format", default="kv", choices=["csv","json","kv","table"], help="Output format")

    @staticmethod
    def build_remote_args(ns) -> List[str]:
        domain   = getattr(ns, "domain", "") or ""
        dc_host  = getattr(ns, "dc", "") or ""
        use_ldaps = 1 if getattr(ns, "ldaps", False) else 0
        port_in   = int(getattr(ns, "port", 0) or 0)
        port      = port_in if port_in > 0 else (636 if use_ldaps else 389)
        gmsa      = getattr(ns, "gmsa", "*") or "*"
        fmt_code  = _fmt_to_code(getattr(ns, "format", "kv"))

        # BOF arg order:
        # 1 domainW, 2 dcHostIn, 3 useLdaps, 4 portNum, 5 gmsaSel, 6 fmtCode
        return [
            f"-Z:{domain}",
            f"-Z:{dc_host}",
            f"-i:{use_ldaps}",
            f"-i:{port}",
            f"-Z:{_space_escape(gmsa)}",
            f"-i:{fmt_code}",
        ]
